import ExpenseItem from "../expense-item/ExpenseItem";
import "./Expenses.css";
import Card from "../expense-item/Card.js";
function Expenses() {
  const expenses = [
    {
      id: "61cd5aab5b2c5331cae30e7e",
      title: "CORECOM",
      amount: "$3,413.82",
      date: "2017-02-27",
    },
    {
      id: "61cd5aab7666348c61b2d94a",
      title: "ZENTIME",
      amount: "$1,315.06",
      date: "2014-01-21",
    },
    {
      id: "61cd5aabfda1bb6e96bdf4c6",
      title: "EXOVENT",
      amount: "$2,417.61",
      date: "2019-11-09",
    },
    {
      id: "61cd5aabe9ce155fa47bba14",
      title: "HATOLOGY",
      amount: "$3,352.84",
      date: "2014-12-06",
    },
    {
      id: "61cd5aabcbf375a9d3a56bee",
      title: "PROWASTE",
      amount: "$1,435.25",
      date: "2018-12-25",
    },
    {
      id: "61cd5aabe09998286f7836c7",
      title: "BUZZMAKER",
      amount: "$2,568.23",
      date: "2021-10-19",
    },
    {
      id: "61cd5aab491fa89cc5afff48",
      title: "TERRAGO",
      amount: "$1,554.93",
      date: "2014-05-23",
    },
    {
      id: "61cd5aab21869746d89a9823",
      title: "BISBA",
      amount: "$3,422.55",
      date: "2016-10-30",
    },
    {
      id: "61cd5aab0da24a11f9c63789",
      title: "MEDALERT",
      amount: "$3,031.89",
      date: "2014-10-17",
    },
    {
      id: "61cd5aab77b1a1544f0fb289",
      title: "VIAGRAND",
      amount: "$2,685.05",
      date: "2018-07-19",
    },
    {
      id: "61cd5aabd983c4fe00bc5c18",
      title: "COMTRAIL",
      amount: "$3,347.12",
      date: "2018-10-27",
    },
    {
      id: "61cd5aaba44dc42faf8ef0a0",
      title: "ORGANICA",
      amount: "$3,941.83",
      date: "2017-07-23",
    },
  ];

  return (
    <Card className="expenses-container">
      <ol>
        {expenses.map((el) => {
          return (
            <li key={el.id}>
              <ExpenseItem
                date={el.date}
                title={el.title}
                amount={el.amount}
              ></ExpenseItem>
            </li>
          );
        })}
      </ol>
    </Card>
  );
}

export default Expenses;
